import React, { Component } from "react";



class Home extends Component {


  state = {
    isLoading: true,
    users: [],
    error: null
  };

  fetchUsers() {
    fetch(`https://jsonplaceholder.typicode.com/users`)
      .then(response => response.json())
      .then(data =>
        this.setState({
          users: data,
          isLoading: false,
        })
      )
      .catch(error => this.setState({ error, isLoading: false }));
  }

  componentDidMount() {
    this.fetchUsers();
  }


  render() {

        const { isLoading, users, error } = this.state;

    return (

              <div class="container">

        <div class="row">



      <React.Fragment>

          // <h2>Welcome to React Router Tutorial</h2>


        {error ? <p>{error.message}</p> : null}
        {!isLoading ? (
          users.map(user => {
            const { username, name, email } = user;
            return (

            <div class="col-lg-4">
        <div class="card mb-5 mb-lg-0">
          <div class="card-body">
            <h5 class="card-title text-muted text-uppercase text-center">{username}</h5>
            <h6 class="card-price text-center"><span class="period">{name}</span></h6>

            <ul class="fa-ul">
              <li><span class="fa-li"><i class="fa fa-check"></i>{email}</span></li>
                  <li class="text-muted"><span class="fa-li"><i class="fa fa-times"></i></span>Free Subdomain</li>
              <li class="text-muted"><span class="fa-li"><i class="fa fa-times"></i></span>Monthly Status Reports</li>
            </ul>



        </div>
      </div>
        </div>

            );
          })
        ) : (
          <h3>Loading...</h3>
        )}
      </React.Fragment>

        </div>



        <p>Duis a turpis sed lacus dapibus elementum sed eu lectus.</p>
      </div>
    );
  }
}

export default Home;
